    return <div>
        <ul>
          <li>
            <Link to="/articles">All topics</Link>
            <Link to="/articles">All topics</Link>
            <Link to="/articles">All topics</Link>
            <Link to="/articles">All topics</Link>
            <Link to="/articles">All topics</Link>
          </li>
        </ul>
      </div>;
};

export default AllTopics;
